const Hello = (props) => {
  const bornYear = () => {
    const yearnNow = new Date().getFullYear();
    return yearnNow - props.age;
  };

  return (
    <div className="App">
      <p>
        Hello {props.name}, you are {props.age} years old
      </p>
      <p>So you were probably born in {bornYear()}</p>
    </div>
  );
}

export default Hello
